embedding_vector_length = 1
model = Sequential()
model.add(LSTM(50, input_shape=(70, 1))) # 50 is the number of "rows" (number of nodes that are vertical)
model.add(Dense(3, activation='softmax')) # 3 for number of classes we have (classes 0, 1, 2 means Dense(3))
model.compile(loss='categorical_crossentropy', optimizer='adam', metrics=['accuracy'])
